script: |
  super -f tsv -I q709.sql | sort > q709.out

vector: true

inputs:
  - name: q709.sql
    data: |
      SELECT DISTINCT col2 AS col2 FROM tab0 WHERE + + col0 + - col1 NOT BETWEEN col1 AND 65 + - col2 * + col2;
  - name: tab0

outputs:
  - name: q709.out
    data: |
      10
      47
      99
